import React from 'react';
import { Button } from '@mui/material';

function App() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Hello World</h1>
      <Button variant="contained" color="primary">
        Test Button
      </Button>
    </div>
  );
}

export default App;
